import React, { Component } from 'react';
import "./Footer.css";
import { FaGithub,FaLinkedin} from "react-icons/fa";
import {MdEmail} from "react-icons/md";

class Footer extends Component{
    render(){
        return(
            <div className="footer-container">
                        <FaGithub/>
                        <FaLinkedin/>
                        <MdEmail/>

            </div>
        )
    }
}

export default Footer;
